// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./2_Owner.sol";

contract TheGame is Owner{
    uint256 creationTime;
    uint256 startTime;
    uint256 voteEndTime;
    uint256 betEndTime;

    constructor(uint256 _startTime, uint256 _voteEndTime, uint256 _betEndTime) Owner() {
        creationTime = block.timestamp;
        startTime = _startTime;
        voteEndTime = _voteEndTime;
        betEndTime = _betEndTime;
    }

    // function getStartTime() public pure returns(string calldata) {
